import React from "react"
import { Todo } from "../types";

interface TodoListProps {
  todos: Todo[];
}

const TodoList = (props: TodoListProps)  => {
  return (
    <div>{props.todos.map((aTodo, index) => <div key={index}>{aTodo}</div>)}</div>
  )
};

export default TodoList
